import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { UserService } from '../services/user.service';
// estas 3 lineas siempre debemos ponerlas asi como estan para poder generar los pdf's
// decia pau que era mejor hacer cada metodo en la pagina que ocupenes, y concuerdo
import * as pdfMake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import { DataApiService } from '../services/data-api.service';
import { Alignment, Margins, Table } from 'pdfmake/interfaces';
import { AngularFirestore, AngularFirestoreCollection } from '@angular/fire/compat/firestore';
(<any>pdfMake).vfs = pdfFonts.pdfMake.vfs;
import { FormControl } from '@angular/forms';
import { Observable } from 'rxjs';

interface reportesadmin{
  date: string;
  level: string;
  school: string;
  aggressor_name: string;
  aggressor_gen: string;
  aggressor_role: string;
  victim_gen: string;
  victim_role: string;
  description: string;
  proceed: string;
  contact: string;
  type_vio: string;
}

@Component({
  selector: 'app-panel-admin',
  templateUrl: './panel-admin.page.html',
  styleUrls: ['./panel-admin.page.scss'],
})


export class PanelAdminPage implements OnInit {
  nombre = new FormControl('');
  tipoviol = new FormControl('');
  hombres = new FormControl('');
  mujeres = new FormControl('');
  denun = new FormControl('');
  todocolection: AngularFirestoreCollection<reportesadmin>;
  todo:Observable<reportesadmin[]>;


  constructor(
    private userService: UserService,
    private router: Router,
    private dataApi: DataApiService,
    private db: AngularFirestore,
    private authService: UserService

  ) { }


  public reports = [];
  public report = '';
  public MaleAggressors = 0;
  public FemaleAggressors = 0;
  public profes = Array();
  public middleSchools = 0;
  public SuperiorSchool = 0;
  public escuelasMayor = "";
  public vio_Fisico = 0;
  public vio_Econo = 0;
  public vio_Sex = 0;
  public vio_Psico = 0;
  public topViol1 = '';
  public totalAgresores = 0;
  public email: string = '';
  public password: string = '';
  public Superior =Array();
  public MediaSuperior = Array();


  ionViewDidEnter(){
    this.todocolection = this.db.collection('Reports');
    this.todo = this.todocolection.valueChanges();
  }
  /**
   * ngOnInit() - Método el cual se dispara al inicializarse la pagina
   * @method getAggressors(): Método encargado de recuperar el genero de los agresores en los reportes
   * @method getEscuelas(): Método encargado de recuperar las escuelas en los reportes
   * @method getEscuelasName(): Método encargado de recuperar en un array el nombre de las escuelas de nivel superior
   * @method getViolenceType(): Método encargado de recuperar el tipo de violencia registrada en los reportes
   * @variable MaleAggressor: Retorna el número de agresores hombres dentro de los reportes
   * @variable FemaleAggressor: Retorna el número de agresores mujeres dentro de los reportes
   * @variable totalAgresores: Retorna el total de los agresores dentro de los reportes
   * @variable middleSchols: Recuento de todas las ecuelas pertenecientes al nivel medio superior
   * @variable SuperiorSchool: Recuento de todas las escuelas pertenecientes al nivel superior
   * @array Superior: Array encargado de contener tods los nombres de las escuelas de nivel superior
   * @variable vio_Econo: Recuento de las incidencias del tipo de violencia economica
   * @variable vio_Psico: Recuento de las incidencias del tipo de violencia psicologica
   * @variable vio_Fisico: Recuento de las incidencias del tipo de violencia fisico
   * @variable vio_Sex: Recuento de las incidencias del tipo de violencia sexual
   */

  ngOnInit() {

    this.db.collection('Reports').valueChanges().subscribe(
      //console.log(val)
      );

    this.dataApi.getAggressors().subscribe(gender => {
      gender.forEach(m => {
        if (m.boe.endsWith("Masculino")) {
          this.MaleAggressors++;
        } else { this.FemaleAggressors++ }
      })// fin del foreach
      this.totalAgresores = gender.length
    });

    this.dataApi.getEscuelas().subscribe(school => {
      school.forEach(level => {
        if (level.schol.endsWith('Medio Superior')) {
          this.middleSchools++;
        } else {
          this.SuperiorSchool++;
        }
      })
    });

    this.dataApi.getViolenceType().subscribe(violence => {
      violence.forEach(type => {
        if (type.violence.type_vio.endsWith('Económica')) { this.vio_Econo++; }
        else if (type.violence.type_vio.endsWith('Física')) { this.vio_Fisico++; }
        else if (type.violence.type_vio.endsWith('Sexual')) { this.vio_Sex++; }
        else if (type.violence.type_vio.endsWith('Psicológica')) { this.vio_Psico++; }
      })
    });

    this.dataApi.getSuperiorNames().subscribe(School=>{
      this.Superior.splice(0);
      School.forEach(SchoolDetail=>{
        if(SchoolDetail.municipio == 'Tepic'){
          const nombreSchool = SchoolDetail.schoolName;
          this.Superior.push(nombreSchool);
        }
      })//fin del for
    });//fin del subscribe

    this.dataApi.getMiddleNames().subscribe(School =>{
      this.MediaSuperior.splice(0);
      School.forEach(SchoolDetail =>{
        if(SchoolDetail.municipio == 'Tepic'){
          const schoolMName = SchoolDetail.middleSName;
          this.MediaSuperior.push(schoolMName);
        }
      })
    });// fin del metodo para las escuelas de media superior

    this.dataApi.getAll2().subscribe(realdata =>{
        realdata.forEach(data => {
          console.log(data.contact);
        })
    });

  };// final del ngOninit

  /**
   * SignOut Metodo para cerrar sesion
   * @method logout() cierra sesion en la ventana donde sea instanciado
   * @variable userService: variable local que hace referencia a la instancia de AuthServices de Firebase para los metodos de esta clase
   */

  signOut() {
    this.userService.logout()
      .then(() => {
        this.router.navigate(['/login']);
      })
      .catch(error => console.log(error));
  };

  onAddUser(){
      this.authService.registerUser(this.email, this.password)
      .then ((res )=>{
        this.router.navigate(['admin/list-books']);
      }).catch(err => console.log('err', err.message));
  };

  /**
   * pdf() - Método de creación de reportes de violencia
   * @variable MalePercentage: Porcentaje total de agresores hombres en reporte
   * @variable FemalePercentage: Porcentaje total de agresores mujeres en reporte
   * @variable escuelasMayor: Indica el nivel educativo con mayor incidencia dentro de los reportes recuperados
   * @variable SuperiorSchool: Recuento de las escuelas de nivel superior en los reportes
   * @variable middleSchools: Recuento de las escuelas de nivel medio superior en los reportes
   * @variable topViol1: Indica la violencia con mayor incidencia dentro de los reportes recuperados
   * @variable vio_Econo: Recuento de las incidencias del tipo de violencia economica
   * @variable vio_Psico: Recuento de las incidencias del tipo de violencia psicologica
   * @variable vio_Fisico: Recuento de las incidencias del tipo de violencia fisico
   * @variable vio_Sex: Recuento de las incidencias del tipo de violencia sexual
   * @variable docDefinition: Varibale encargada de crear todo el cuerpo del pdf
   */

  reportes(){
      this.db.collection('Reports').valueChanges().subscribe(val=>this.denun.setValue(val));
  };

  estadisticaescuela(){
    if (this.SuperiorSchool > this.middleSchools) {
      this.nombre.setValue('Nivel Superior')
    } else {
      this.nombre.setValue('Nivel Medio Superior')
    }

    if ((this.vio_Econo > this.vio_Fisico) && (this.vio_Econo > this.vio_Psico) && (this.vio_Econo > this.vio_Sex)) { this.tipoviol.setValue('Económica') }
    else if ((this.vio_Fisico > this.vio_Econo) && (this.vio_Fisico > this.vio_Psico) && (this.vio_Fisico > this.vio_Sex)) { this.tipoviol.setValue('Física') }
    else if ((this.vio_Psico > this.vio_Econo) && (this.vio_Psico > this.vio_Fisico) && (this.vio_Psico > this.vio_Sex)) { this.tipoviol.setValue('Psicológica'); }
    else if ((this.vio_Sex > this.vio_Econo) && (this.vio_Sex > this.vio_Psico) && (this.vio_Sex > this.vio_Fisico)) { this.tipoviol.setValue('Sexual') }
    else {
      this.tipoviol.setValue('Igual numero de incidencias')
    }

    this.hombres.setValue(((this.MaleAggressors * 100) / this.totalAgresores).toFixed(1)+'%');
    this.mujeres.setValue(((this.FemaleAggressors * 100) / this.totalAgresores).toFixed(1)+'%');

  };

  pdfreport(){
    console.log(this.db.collection('Reports').valueChanges().subscribe(val=>this.denun.setValue(val)));
    let docDefinition= {
      pageMargins: [40, 60, 40, 60] as Margins,
      /**
       * header - encabezado con una función para retornar todo el diseño
       * @function function: contiene una función anónima para crear el encabezado del PDF
       */
      header: function () {
        return {
          columns: [
            {
              image: 'logoTec',
              width: 40,
              margin: [540, 10, 0, 0] as Margins
            },
                {
          image: 'logoProgreso',
            width: 60,
              margin: [10, 10, 0, 0] as Margins
        },
        {
          text: 'Reporte de estadisticas generales de las denuncias\nProgreso para México',
            style: 'header',
              alignment: 'center' as Alignment,
                margin: [-90, 10, 0, 0] as Margins
        }
              ]
        } // fin del returnb
      }, //fin del header
      content:[

      ],// fin del content
      /**
             * images: Diccionario de imagenes en formato URI para la renderizacion yu vizualizacion de las mismas, al momento de llamar al metodo
             *  recomendable no quitar el folding de ser posibl, esto porque los URI son demaciado largos y se extiende mucho hacia abajo
             * @name logoTec: Nombre que hace referencia a la imgen del logo del TEC
             * @name logoProgreso: Nombre que hace referencia al logo de la A.C. Progreso Para México
             */
      images: {
        logoTec: 'data:image/png;base64,',
        logoProgreso: 'data:image/png;base64,'
      } // aqui estan las imagenes que se van a usar dentro del pdf
      // de momento solo estan, logoTec y logoProgreso
      ,
      /**
       * styles: Diccionario de estilos para el texto del pdf
       * @name header: Estilo preferible par el header principal del PDF
       * @name normal: Estilo preferible para el texto normal o del cuerpo del PDF
       */
      styles: {
        header: {
          bold: true,
          italics: true,
          fontSize: 10,
          color: 'grey',
          alignment: 'justify' as Alignment
        },
        normal: {
          italics: true,
          fontSize: 14,
          margin: [0, 5, 0, 0] as Margins
        }
      }// fin de la seccion para los estilos varios
    } // fin del docDefinition
    const now = new Date();
    pdfMake.createPdf(docDefinition).open(null, window.open("Reportes"+now.toLocaleDateString()))
  };

  pdfEstadisticas() {
    if (this.SuperiorSchool > this.middleSchools) {
      this.escuelasMayor = 'Nivel Superior'
    } else {
      this.escuelasMayor = 'Nivel Medio Superior'
    }

    if ((this.vio_Econo > this.vio_Fisico) && (this.vio_Econo > this.vio_Psico) && (this.vio_Econo > this.vio_Sex)) { this.topViol1 = 'Economica'; }
    else if ((this.vio_Fisico > this.vio_Econo) && (this.vio_Fisico > this.vio_Psico) && (this.vio_Fisico > this.vio_Sex)) { this.topViol1 = 'Fisica'; }
    else if ((this.vio_Psico > this.vio_Econo) && (this.vio_Psico > this.vio_Fisico) && (this.vio_Psico > this.vio_Sex)) { this.topViol1 = 'Psocologica'; }
    else if ((this.vio_Sex > this.vio_Econo) && (this.vio_Sex > this.vio_Psico) && (this.vio_Sex > this.vio_Fisico)) { this.topViol1 = 'Sexual'; }
    else {
      this.topViol1 = 'Todos son iguales';
    }

    let MalePercentage = (this.MaleAggressors * 100) / this.totalAgresores;
    let FemalePercentage = (this.FemaleAggressors * 100) / this.totalAgresores;

    let docDefinition = {
      pageMargins: [40, 60, 40, 60] as Margins,
      /**
       * header - encabezado con una función para retornar todo el diseño
       * @function function: contiene una función anónima para crear el encabezado del PDF
       */
      header: function () {
        return {
          columns: [
            {
              image: 'logoTec',
              width: 40,
              margin: [540, 10, 0, 0] as Margins
            },
            {
              image: 'logoProgreso',
              width: 60,
              margin: [10, 10, 0, 0] as Margins
            },
            {
              text: 'Reporte de estadisticas generales de las denuncias\nProgreso para México',
              style: 'header',
              alignment: 'center' as Alignment,
              margin: [-90, 10, 0, 0] as Margins
            }
          ]
        }
      },
      // fin de la funcion para el header
      //con esta funcion nos permite poner más de un solo elemento en el header
      //normalmente solo permite poner uno
      /**
       * content: aqui se crea todo el contenido del cuerpo propiemante del pdf, en necesario el casteo explicito a en ciertas propiedades del pdfMake
       *  como lo es el Alignment, Margins e incluso el Table, esto para que se pueda mostrar el pdf a la hora de invocar el metodo, y no enseñe solo una
       *  página en blanco
       */
      content: [
        {
          table: {
            widths: [250, '*'],
            body: [
              [
                { text: 'Parámetro', style: { alignment: 'center' as Alignment, bold: true } },
                { text: 'Resultados en porcentaje', style: { alignment: 'center' as Alignment, bold: true } }
              ],
              [
                'Agresores hombres en todas las instituciones', { text: MalePercentage.toFixed(1) + '%', style: { alignment: 'center' as Alignment } }
              ],
              [
                'Agresores mujeres en todas las instituciones', { text: FemalePercentage.toFixed(1) + '%', style: { alignment: 'center' as Alignment } }
              ],
              [
                'Nivel educativo con mayor incidencia de violencia:', { text: this.escuelasMayor, style: { alignment: 'center' as Alignment } }
              ],
              [
                'Violencia de mayor incidencia', { text: this.topViol1, style: { alignment: 'center' as Alignment } }
              ]
            ]
          } as Table,
          margin: [0, 20, 0, 0] as Margins// fin de la tabla
        }
      ],
      /**
       * images: Diccionario de imagenes en formato URI para la renderizacion yu vizualizacion de las mismas, al momento de llamar al metodo
       *  recomendable no quitar el folding de ser posibl, esto porque los URI son demaciado largos y se extiende mucho hacia abajo
       * @name logoTec: Nombre que hace referencia a la imgen del logo del TEC
       * @name logoProgreso: Nombre que hace referencia al logo de la A.C. Progreso Para México
       */
      images: {
        logoTec: 'data:image/png;base64,',
        logoProgreso: 'data:image/png;base64,'
      } // aqui estan las imagenes que se van a usar dentro del pdf
      // de momento solo estan, logoTec y logoProgreso
      ,
      /**
       * styles: Diccionario de estilos para el texto del pdf
       * @name header: Estilo preferible par el header principal del PDF
       * @name normal: Estilo preferible para el texto normal o del cuerpo del PDF
       */
      styles: {
        header: {
          bold: true,
          italics: true,
          fontSize: 10,
          color: 'grey',
          alignment: 'justify' as Alignment
        },
        normal: {
          italics: true,
          fontSize: 14,
          margin: [0, 5, 0, 0] as Margins
        }
      }// fin de la seccion para los estilos varios
    };// fin del let docDefinition

    pdfMake.createPdf(docDefinition).open()
  };
};
